import React from 'react';
import styled from 'styled-components';

const UserDetails = ({ firstName, email, createdAt, username }) => (
  <DetailsCard>
    <h2>Detalhes do Usuário</h2>
    <p><strong>Nome:</strong> {firstName}</p>
    <p><strong>Email:</strong> {email}</p>
    <p><strong>Data de Criação:</strong> {createdAt}</p>
    <p><strong>Nome de Usuário:</strong> {username}</p>
  </DetailsCard>
);

const DetailsCard = styled.div`
  background-color: #222;
  padding: 20px;
  border-radius: 8px;
  flex: 1;
  color: #f5f5f5;

  h2 {
    margin-top: 0;
    font-size: 1.5rem;
  }

  p {
    margin: 5px 0;
    font-size: 1rem;
  }

  strong {
    color: #ea4f97;
  }

  @media (max-width: 768px) {
    padding: 15px;
  }
`;

export default UserDetails;
